import React from 'react';
import { css } from 'emotion';
import './App.css';

function App() {
  return (
    <div className={styles.root}>
      Hey
    </div>
  );
}

const styles = {
  root: css({
    width: '100vw',
    height: '100vh',
    backgroundImage: 'linear-gradient (214, 47%, 23% to hsl(237, 49%, 15%))'
  })
};

export default App;
